geodesic_distance = 250
csv_directory = '../data/cities'
def city(request):
	city = request.POST.get('city_field')
	city = whitespace.join(city.split('-'))
	current_year = datetime.datetime.now().year
	
	context = dict()

	curr_vector, closest_name, closest_vector = _fetch_closest_city(city, geodesic_distance, current_year, current_year)
	future_vector, future_closest_name, future_closest_vector = _fetch_closest_city(city, geodesic_distance, current_year + 20, current_year)

	context['curr_city'] = city
	context['curr_city_state'] = cities_to_state[city.encode('utf-8').strip()]

	context['curr_closest_city'] = closest_name
	context['curr_closest_city_state'] = cities_to_state[closest_name.encode('utf-8').strip()]
	
	context['future_closest_city'] = future_closest_name
	context['future_closest_city_state'] = cities_to_state[future_closest_name.encode('utf-8').strip()]

	context['curr_city_vector'] = curr_vector.tolist()[:12]
	context['future_city_vector'] = future_vector.tolist()[:12]
	context['curr_closest_vector'] = closest_vector.tolist()[:12]
	context['future_closest_vector'] = future_closest_vector.tolist()[:12]
	return render(request, 'city.html', context)

def _fetch_city_vector(city_file, current_year):
	curr_tasmax_vector = np.array([])

	city_file = os.path.join(csv_directory, city_file)
	with open(city_file, 'r') as curr_tasmax_file:
		tasmax_reader = csv.reader(curr_tasmax_file, delimiter=',')
		for tasmax_data in tasmax_reader:
			if int(tasmax_data[0]) != current_year:
				continue

			curr_tasmax_vector = np.array(tasmax_data[1:], dtype='float')
			break

	return curr_tasmax_vector

def _fetch_closest_city(city_name, geodesic_distance, current_year, other_current_year):
	city_identifier = cities_to_ids[city_name]
	city_file = '{}_tasmax.csv'.format(city_identifier)

	curr_latlon = cities_to_latlon[city_identifier]
	curr_tasmax_vector = _fetch_city_vector(city_file, current_year)
	
	best_min_identifier = None
	best_min_vector = None
	best_min_distance = float('inf')
	for csv_file in os.listdir(csv_directory):
		if csv_file == city_file:
			continue
		other_identifier = csv_file[:csv_file.find('_')]
		other_latlon = cities_to_latlon[other_identifier]
		
		if geodesic(curr_latlon, other_latlon).miles < geodesic_distance:
			continue

		other_city_vector = _fetch_city_vector(csv_file, other_current_year)
		curr_distance = np.sum(np.abs(curr_tasmax_vector - other_city_vector))
		if best_min_distance > curr_distance:
			best_min_identifier = other_identifier
			best_min_distance = curr_distance
			best_min_vector = other_city_vector

	best_name = ids_to_cities[best_min_identifier]
	return (curr_tasmax_vector, best_name, best_min_vector)

def fetch_future_city_data(request):
	city_name = request.POST.get('curr_city')
	years_ahead = int(request.POST.get('years_ahead'))
	current_year = datetime.datetime.now().year

	future_vector, other_name, other_vector = _fetch_closest_city(city_name, geodesic_distance, current_year + years_ahead, current_year)
	data = {
		'future_city_vector': future_vector.tolist()[:12],
		'other_name': other_name,
		'future_closest_vector': other_vector.tolist()[:12]
	}
	return HttpResponse(json.dumps(data), content_type='application/json')







